import logo from './logo.svg';
import './App.css';
import { ButtonSolid, Grid, Box, Text, Icon } from 'design-system';

function App() {
  return (
    <div className="App">
      <Box mt="30px" height="150px" bg="red">
        <Box pl="auto" pr="auto" pt="20px" mb="44px">
            <p>Hi Anakin</p>
        </Box>
        <Box ml="auto" mr="auto">
          <p>Your balance</p>
        </Box>

      </Box>
      <Box height="150px" bg="white">

      </Box>
    </div>
  );
}

export default App;
